import React from "react";

const classes = {
	mapContainer: {padding:"1em"}
}

const DisplayMap = (props) => {
    const {imgsrc} = props;
	return (
		<div className={classes.mapContainer}>
			<img style={{width:"100%"}} src={imgsrc} alt="requested map" />
		</div>
	);
}

export default DisplayMap;
